import React from 'react'
import './NeutralButton.css'
import { Link } from 'react-router-dom'

const NeutralButton = ({text,link}) => {
  return (
    <>
    <Link to={link}></Link>
        <button className = "neutral-button">{text}</button>
    </>
  )
}

export default NeutralButton;
